/* eslint-disable jsx-a11y/anchor-has-content */
import React from 'react';
import { Card, Button } from 'react-bootstrap';
import styled from 'styled-components';
import './Projects.css'
import photosite from './assets/img/visualsbydandre.jpg';

const ProjectList = styled.div`
    padding-top: 7%;
    width: 100%;
    height: 100%;
`;

const Title = styled.h3`
    display: flex;
    justify-content: center;
    text-decoration: underline;
    padding-bottom: 5%;
    font-size: 44px;
`;

const Center = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
`;

const Spacing = styled.div`
    padding-bottom: 25px
`;

const projectTitle = {
    fontSize: "24px",
    color: "rgb(39, 221, 221)" 
};

const background = {
    backgroundColor: "black",
    color: "white"
};

export default function Projects() {
    return (
        <ProjectList id="projects">
            <Title>Projects</Title>
            <Center>
                <Card style={{width: "600px"}}>
                    <Card.Img variant="top" src={photosite} />
                    <Card.Body style={background}>
                        <Center>
                            <Card.Title style={projectTitle}>
                                Photography Portfolio
                            </Card.Title>                        
                        </Center>
                        <Card.Text>
                            <Spacing>
                                Portfolio website for my photography and videos.                                
                            </Spacing>
                        </Card.Text>
                        <Center>
                            <Spacing>
                                <Button 
                                variant="primary" 
                                style={{fontSize: "20px"}}
                                href="https://visualsbydandre.com"
                                >
                                    Visit Website
                                </Button>                                  
                            </Spacing>
                        </Center>
                    </Card.Body>                
                </Card>     
            </Center>                        
        </ProjectList>
    )
}

